import React, { Component } from 'react'
import FetchService from '../helper/FetchService'


export default class StoriesFromYoutube extends Component {
    constructor() {
        super();
        this.state = {
            responseObject: {}
        }
    }

    componentDidMount() {
        console.log("Mounted");
        FetchService.GET("https://youtube.googleapis.com/youtube/v3/playlistItems?part=contentDetails&maxResults=50&playlistId=PLIy7-i_9rAyQ9teMuV1dJHWuVcsW5y39o&key=AIzaSyD2gBCggKBW5r6XkCzCa4dLoQuL7mnB9Ok")
            .then((res) => {
                // console.log(res['feed']['entry'][0]['content']['$t']);
                // this.setState({ responseObject: res['feed']['entry'] });
                this.setState({ responseObject: res['items'] });

                console.log(this.responseObject)


            })
    }
    render() {
